var algorithm_base_name = "background";
var pipelines_min = 2;
var pipelines_max = 5;
var pipelines = [];

function fetch_complete(){
  //console.log(pipelines);
  var num_contexts = 0;
  var new_pipeline = {
    contexts: [],
    programs: [],
    stages: []
  };
  for(var i = 0; i < pipelines.length; i++){
  	for(var j = 0; j < pipelines[i].contexts.length; j++){
     //console.log(pipelines[i].contexts[j]);
     pipelines[i].contexts[j].name += i;
     pipelines[i].contexts[j].width.type = OpenGLDimension.Type.EXACT;
     pipelines[i].contexts[j].height.type = OpenGLDimension.Type.EXACT;
     pipelines[i].contexts[j].width.value = "return window.innerWidth/2;;";
     pipelines[i].contexts[j].height.value = "return window.innerHeight/2;";

      new_pipeline.contexts.push(pipelines[i].contexts[j]);

    }
  	for(var j = 0; j < pipelines[i].programs.length; j++){
     //console.log(pipelines[i].programs[j]);]);
     pipelines[i].programs[j].name += i;
     new_pipeline.programs.push(pipelines[i].programs[j]);

    }
  	for(var j = 0; j < pipelines[i].stages.length; j++){
     //console.log(pipelines[i].stages[j]);]);
     pipelines[i].stages[j].name += i;
     pipelines[i].stages[j].context += i;
     pipelines[i].stages[j].program += i;
      new_pipeline.stages.push(pipelines[i].stages[j]);
    }
    }
  //console.log(new_pipeline);

  pipeline.setProto(new_pipeline);

  for(var i = 0; i < pipeline.contexts.length; i++)
  {
      var canvas = pipeline.contexts[i].canvas;

      canvas.style.position = 'absolute';
      canvas.style.display = 'inline-block'
      canvas.style.margin = '0px !important';
      canvas.style.padding = '0px !important';
      canvas.style.left = Math.floor(i%2)*50+"%";
      canvas.style.top = Math.floor(i/2)*50+"%";

      canvas.style.width = '50%';
      canvas.style.height = '50%';
      canvas.style.zIndex = '10';
      document.body.append(canvas);
  }
}

for(var i = pipelines_min; i <= pipelines_max; i++){
  var algorithm = algorithm_base_name + i;
  console.log("fetching: "+algorithm);
  fetch('https://www.MetaHumanity.xyz/algorithms/' + algorithm + '.json')
    .then(function (response) {
    response.json().then(function (val) {
      var proto = OpenGLPipelineMessage.fromObject(val.pipeline);
      //console.log(proto);
      //pipeline.setProto(proto);
      //console.log(pipeline)
	pipelines.push(proto);
	if(pipelines.length == pipelines_max-pipelines_min+1)
      fetch_complete();
    }.bind(this))
      .catch(function (e) {
      console.log(e);
    }.bind(this))
  }.bind(this));
}
